import Card from "../card/card.js"
import "./trending.css"


const Trending = ({trendingNfts}) => {
    const trending = Promise.all(trendingNfts).then(response => response.data)
    console.log(trending)
    const displayArray = 
        trending.map((obj,i) => {
            return <Card
                    key={obj.id}
                    title={obj.name}
                />        
    })

    return(
        <div className="trending">
                {displayArray}
        </div>
    )
}

export default Trending;
